    false,nt"url": null,nt"notes": "NODC Accession 0129847 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1201
    in the Indian Ocean from 2012-01-10 to 2012-02-12. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
    ADCP, CTD and GPS. These data were collected by Ren-Chieh Lien of University of
    Washington, and by University of California - San Diego; Scripps Institution of
    Oceanography as part of DYNAmics of Madden-Julian Oscillation/DYNAMO Moorings. The
    Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part of
    the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
    not available in this accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
